<?php $__env->startSection('content'); ?><p>The Bachelor's Laura Calleri was sent packing by Locky Gilbert on Wednesday night in a shock elimination which saw five ladies get the boot from the mansion.</p>

<p>And on Wednesday, the 25-year-old took nasty a swipe at the former Survivor star, saying they would never have worked out because their clashing interests in life.</p>

<p>She told The Daily Telegraph: 'I have never been to Bali. From there, it was a bit like I didn't know if we were going to click, especially because fake designer stuff is a massive faux pas and I am really not about that.' </p>

<p>'I got ripped off by a guy that likes Bintang!' The Bachelor's Laura Calleri, 25, took a swipe at Locky Gilbert following her elimination on Wednesday</p>

<p>Instead, Laura is hoping she'll be cast on Bachelor in Paradise for her second shot at love.</p>

<p>'Surely they would be able to do some good matchmaking for me now since I got ripped off by a guy that likes Bintang,' she said.</p>

<p>In her first meeting with Locky, the brunette beauty made it no secret she liked the finer things in life when she told him that the best present she had ever received was a 'Louis Vuitton purse'.</p>

<p>Expensive taste: In her first meeting with Locky (pictured), she made it no secret she liked the finer things in life and told him that the best present she had ever received was a 'Louis Vuitton purse'</p>

<p>The finer things in life: Laura said, 'I have never been to Bali. From there, it was a bit like I didn't know if we were going to click, especially because fake designer stuff is a massive faux pas and I am really not about that'</p>

<p>The reality TV star insisted that her 'Louis Vuitton purse' comment on the red carpet was a joke about her high standards.</p>

<p>Laura, who is a marketing co-ordinator, also told the publication that she was unapologetic for her expensive taste. </p>

<p>'That is how I am and I don't apologise for that. I just want to make sure that the guy I end up with is on the same page as me about liking nice things,' she said. </p>

<p>Laura was among the five ladies booted out of the mansion on Wednesday.</p>

<p>Second chance: Instead, Laura is hoping she'll be cast on Bachelor in Paradise for her second shot at love, saying: 'Surely they would be able to do some good matchmaking for me now since I got ripped off by a guy that likes Bintang (Indonesian beer)'</p>

<p>Upset: Laura was among the five ladies booted out of the mansion. 'Is he serious? He could have had a trophy wife, but nope. Fuming. F**king fuming!' she screamed as she stormed out to a waiting car</p>

<p>'Is he serious? He could have had a trophy wife, but nope. Fuming. F**king fuming!' she screamed as she stormed out to a waiting car. </p>

<p>Also eliminated was Areeba, 25, who fumed that this year's Bachelor clearly had a penchant for 'basic girls'.</p>

<p>'This is definitely the first time I have ever been rejected by a guy. I don't care because he obviously likes basic girls, and that's not me. I ain't basic,' she pouted.</p>

<p>The Bachelor continues on Thursday at 7.30pm on Channel 10 </p>

